void MOD_mkPacketModifier::vcd_prims(tVCDDumpType dt, MOD_mkPacketModifier &backing)
{
  INST_cf_verbosity.dump_VCD(dt, backing.INST_cf_verbosity);
  INST_req_ff.dump_VCD(dt, backing.INST_req_ff);
}

void MOD_mkPacketModifier::vcd_submodules(tVCDDumpType dt,
					  unsigned int levels,
					  MOD_mkPacketModifier &backing)
{
  INST_deparser.dump_VCD(dt, levels, backing.INST_deparser);
  INST_serializer.dump_VCD(dt, levels, backing.INST_serializer);
}
